// This is the Link API
import Link from "next/link";

const Index = () => (
  <div>
  <h1>MAIN PAGE - USE </h1>
    <Link href="/about">
      <a>About Page</a>
    </Link>
    <p>Hello Next.js</p>
  </div>
);

export default Index;
